import React from 'react'

const HomePage = () => {
  return (
    <div>Templewood Recruitment Ltd are a leading independent recruitment consultancy, specialising in the supply of high calibre Temporary, Contract and Permanent staff within the Professional Services and Health & Social Care sectors.

    Created and run by a senior management team, benefiting from over 50 years of recruitment expertise; our goal is to provide a world class and highly effective service to both our clients and candidates. Striving to ‘wow’ our customers in every interaction; our long term vision is to positively challenge the status quo within the recruitment industry and to firmly establish Templewood Recruitment as a trusted business partner and the definitive agency of choice for our service users.

    We believe in providing Recruitment solutions which you can depend upon and are designed to meet your specific needs. So, whether you are looking for a temporary worker to fill an unexpected absence in your team or seeking to fill a strategic permanent position to help elevate your business to the next level, feel free to get in touch with one of our versatile team, and… “Experience Certainty.”</div>
  )
}

export default HomePage
